import React from "react";
import { card } from "../components/card";

const images = [
    "https://images.unsplash.com/photo-1506744038136-46273834b3fb?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjM3Njd9&w=1000&q=80",
    "https://cdn.pixabay.com/photo/2018/04/13/18/50/field-3317258_960_720.jpg",
    "https://www.tom-archer.com/wp-content/uploads/2018/06/milford-sound-night-fine-art-photography-new-zealand.jpg",
];

const index = () => {
    return (
        <>
            {card({ img: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjM3Njd9&w=1000&q=80" })}

        </>
    )
}

export default index;
